import React, { Component } from "react";

class Block extends Component {
  render() {
    const { response, parentHash} = this.props.block;
    return (
      <div style={divStyle}>
        <h3>{response}</h3>
        <p> <b> parentHash : </b>{parentHash}</p>

      </div>
    );
  }
}

export default Block;

const divStyle = {
  background: "#7FD2F0",
  margin: "50px",
  padding: "30px"
};
